public class Q7 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		/*Print Numbers from 1 to N:
Take an integer N and print numbers from 1 to N using a while loop.*/
		int num = 101;
		int i = 0;
		while( i<num )
		{
			System.out.println(i);
			i++;
		}
		
		
	}

}
